import {Link} from 'react-router-dom';
import ArticleList from './ArticleList';
import CategoryBar from "../Category/CategoryBar";
import Bar from "../Bar";
import '../App.css'
import { FetchWithoutId, IsLogin } from '../func';

function ArticleLists({user, cookie}){
    const articleList = Array.from(FetchWithoutId("board").data);

    if(!articleList){ return <div> Loading... </div> }
    else {
        return (
            <>  {console.log()}
                <Bar /> 
                {IsLogin(cookie) && <CategoryBar user={user}/>}
                <ArticleList user={user} articleList={articleList} /><br/>

                <div style={{width: "100%", textAlign: "center"}}>
                    <Link to={`/`} id="none"> <button id="btn-default"> Home </button></Link>
                    {IsLogin(cookie) && <Link to={`/board/add/0`} id="none"> <button id="btn-post"> Write </button></Link>}
                </div>
            </>
        )
    }
}

export default ArticleLists;
